void router2(data_t &key, int &s0, int &s1, pn_t &pn) {
//#pragma HLS ARRAY_PARTITION variable=pnArray cyclic factor=2 dim=1 // for solution1 with 2.8 ns clk
#pragma HLS INTERFACE ap_vld port=s1
#pragma HLS INTERFACE ap_vld port=s0
#pragma HLS INTERFACE ap_ovld port=pn
#pragma HLS INTERFACE ap_vld port=key
#pragma HLS RESOURCE variable=TdArray core=ROM_2P_BRAM
#pragma HLS RESOURCE variable=pnArray core=ROM_2P_BRAM

	// Step1: mod r£¬ use bit-shift for mod operation
//	uint10_t idx = (key << 22) >> 22; // int idx = hash[i]%nSlot; // 32 - 10
	ap_uint<10> idx = (ap_uint<10>)key; // int idx = hash[i]%nSlot; // 32 - 10

	// Step2: slot lookup
	ap_uint<13> d = TdArray[idx];

	// Step3: universal shift hash and mod m
	ap_uint<13> key2 = (ap_uint<13>)(key >> s1) ^ (ap_uint<13>)key;  // >> shift cost 3.2 ns
	ap_uint<13> key1 = (ap_uint<13>)(key >> s0) + (ap_uint<13>)d;
	ap_uint<13> f = (key1 ^ key2);

//	ap_uint<13> f = (((ap_uint<13>)(key >> s0) + (ap_uint<13>)d) ^ ((ap_uint<13>)(key >> s1) ^ (ap_uint<13>)key));

//	uint13_t f = (((uint13_t)(key >> s0) + (uint13_t)d) ^ ((uint13_t)(key >> s1) ^ (uint13_t)key)); // 32 - 13

	pn = pnArray[f]; // cost >= 2 cycles
//	pn = (pn_t)f;
	return;
}
